public String listProviderNames() {
  StringBuilder sb = new StringBuilder(providers.size() * 32);
  for (AWSCredentialsProvider provider : providers) {
    sb.append(provider.getClass().getSimpleName());
    sb.append(' ');
  }
  return sb.toString();
}
